      <div style="width:100%;height:0;padding-bottom:100%;position:relative;"><iframe src="https://giphy.com/embed/YnexM9LwlwGu4Z1QnS" width="100%" height="100%" style="position:absolute" frameBorder="0" class="giphy-embed" allowFullScreen></iframe></div><p><a href="https://giphy.com/gifs/visuals-network-connectivity-YnexM9LwlwGu4Z1QnS">via GIPHY</a></p>
    </>

